import React from 'react';

import NavBar from '../NavBar/NavBar';
import LoginBox from '../LoginBox/LoginBox';
import Paper from '@material-ui/core/Paper';

const LoginContainer = () => {
    return (
        <div>
            <NavBar />
            <Paper>
                <LoginBox />
            </Paper>

        </div>
    )
};

export default LoginContainer;
